import React from "react";
import { TextField, Button } from "@material-ui/core";
import "./style.scss";

function Login() {
  return (
    <div>
      <h1>Login</h1>
      <form className="form-container">
        <TextField
          variant="outlined"
          margin="normal"
          required
          fullWidth
          id="email"
          label="Email Address"
          autoFocus
        ></TextField>
        <TextField label="password"></TextField>
        <Button>Sign In</Button>
      </form>
    </div>
  );
}

export default Login;
